import React from 'react';
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';

const colorPalette = [
  '#4361ee', '#3a0ca3', '#4895ef', '#4cc9f0',
  '#f72585', '#7209b7', '#b5179e', '#560bad',
  '#480ca8', '#3a0ca3', '#3f37c9', '#4361ee'
];

const detectChartType = (data, query = '') => {
  if (!data?.length) return 'table';
  const cols = Object.keys(data[0]);
  const lcQuery = query.toLowerCase();

  if (cols.some(c => c.toLowerCase().includes('date'))) return 'line';
  if (lcQuery.includes('compare') && cols.length > 2) return 'column';
  if (lcQuery.includes('distribution') || lcQuery.includes('percentage')) return 'pie';
  if (cols.length === 2) return lcQuery.includes('trend') ? 'line' : 'column';
  return 'table';
};

const prepareChartData = (data, chartType) => {
  const cols = Object.keys(data[0] || {});

  if (chartType === 'pie') {
    const [nameCol, valueCol] = cols;
    return data.map(row => ({
      name: row[nameCol],
      y: Number(row[valueCol]) || 0,
      color: colorPalette[Math.abs(row[nameCol]?.hashCode?.() || 0) % colorPalette.length]
    }));
  }

  if (chartType === 'line') {
    const dateCol = cols.find(c => c.toLowerCase().includes('date'));
    const valueCol = cols.find(c => c !== dateCol);
    return data.map(row => ({
      x: new Date(row[dateCol]).getTime(),
      y: Number(row[valueCol]) || 0,
      name: new Date(row[dateCol]).toLocaleDateString()
    }));
  }

  if (chartType === 'column') {
    const [nameCol, ...valueCols] = cols;
    return valueCols.map((col, i) => ({
      name: col,
      data: data.map(row => ({
        name: row[nameCol],
        y: Number(row[col]) || 0,
        color: colorPalette[i % colorPalette.length]
      }))
    }));
  }

  return [];
};

String.prototype.hashCode = function() {
  let hash = 0;
  for (let i = 0; i < this.length; i++) {
    hash = (hash << 5) - hash + this.charCodeAt(i);
    hash |= 0;
  }
  return hash;
};

const getChartOptions = (chartType, data, query) => ({
  title: { text: query },
  colors: colorPalette,
  chart: { type: chartType, backgroundColor: 'transparent' },
  plotOptions: {
    series: { borderRadius: chartType === 'column' ? 4 : 0 },
    column: { grouping: false, borderWidth: 0 }
  },
  xAxis: { type: chartType === 'line' ? 'datetime' : 'category' },
  series: chartType === 'column' ? data : [{ data }],
  accessibility: { enabled: false },
  credits: { enabled: false }
});

export default function VisualizationRenderer({ response }) {
  const { type, data, query } = response || {};

  if (type === 'string') {
    return <div className="response-string">{data}</div>;
  }

  if (type === 'table' && Array.isArray(data)) {
    const chartType = detectChartType(data, query);
    const chartData = prepareChartData(data, chartType);
    const showChart = data.length > 0 && chartType !== 'table';

    return (
      <div className="response-container">
        {showChart && (
          <div className="chart-container">
            <HighchartsReact
              highcharts={Highcharts}
              options={getChartOptions(chartType, chartData, query)}
            />
          </div>
        )}
        <div className="response-table">
          <table>
            <thead>
              <tr>{Object.keys(data[0]).map(col => <th key={col}>{col}</th>)}</tr>
            </thead>
            <tbody>
              {data.map((row, i) => (
                <tr key={i}>
                  {Object.values(row).map((val, j) => (
                    <td key={j}>{val?.toString() || '—'}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    );
  }

  return <div className="error">Invalid response format</div>;
}
